INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (1, 'back [x] up', 'to support or defend someone', 'When the class was making fun of me, only the teacher backed me up.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (2, 'mistake for', 'перепутать кого-то с кем-то', 'I often mistake her for her mother on the phone.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (3, 'call around', 'to contact multiple people', 'Roy called around to find a nearby mechanic.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (4, 'call [x] off', 'to cancel a planned event', 'We called the party off. / We called off the party.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (5, 'stem from something', 'быть результатом чего-то', 'Her problems stem from her difficult childhood.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (6, 'check [x] out', 'to examine a person or thing; when used in reference to a person, can connote looking at them with romantic or sexual interest', 'I’ll check the contract out. / I’ll check out the contract.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (7, 'cheer [x] up', 'to make someone happy, especially if they were previously sad', 'Reading always cheers me up on a rainy day.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (8, 'clean up', 'to be extremely successful in an endeavor such as business, sports, or gambling. to stop engaging in questionable behavior, such as consuming drugs or alcohol', 'Our hockey team cleaned up at the tournament and went home undefeated. Her boss said she had to either clean up or find a new job.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (9, 'clean [x] up', 'to tidy an area', 'John cleaned the living room up. / John cleaned up the living room.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (10, 'come around', 'to change one’s opinion or see a new point of view', 'I never liked seafood but came around after trying fried calamari.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (11, 'come between [x]', 'to interfere with a relationship between two people', 'After more than fifty years of partnership, nothing could come between them.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (12, 'rip off', 'обманывать в сделке', 'This service rips off their customers');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (13, 'come out of [x]', 'to happen as a consequence of another event', 'We missed a day of school, so at least some good came out of our boring class trip.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (14, 'come up', 'to arise as a topic of discussion, to approach, to occur (of an event or situation)', 'This issue never came up in our discussions. While I was walking along the fence, a cow came up and licked my face. I do not worry about problems until they come up.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (15, 'come up with something', 'think up; to think of an idea, especially as the first person to do so, or to produce a solution', 'She came up with the best solution.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (16, 'count on [x]', 'to rely or depend on someone or something', 'If I’m ever making a mistake, I can count on my friends to warn me.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (17, 'crack down on [x]', 'to attack or punish someone harshly; to penalize a behavior', 'Ever since last month’s accident, police have been cracking down on drunk driving.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (18, 'dive into [x]', 'to eagerly begin a pursuit or activity', 'I’ll dive into that new TV show later tonight.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (19, 'dress up', 'to put on nice clothes', 'Abed dressed up for the award ceremony.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (20, 'end up', 'to eventually reach some conclusion or destination', 'After thinking for a day, he ended up taking the job.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (21, 'fall apart', 'to break into pieces or to experience acute mental or emotional distress', 'My new dress completely fell apart after just two washes. He endured all kinds of harassment at work without flinching but fell apart when his cat got sick.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (22, 'fill [x] up', 'to put into a container as much as it can contain', 'Bruce filled his water bottle up to the brim. / Bruce filled up his water bottle to the brim.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (23, 'find out [x]', 'to discover or learn something', 'We didn’t find out the news until we got back from dinner..');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (24, 'get [x] across', 'to successfully communicate or explain something', 'The professor spoke for hours, but they didn’t get anything across to the students.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (25, 'get ahead', 'to succeed or progress', 'You’ll never get ahead at this company unless you follow the rules.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (26, 'get along with [x]', 'to be on harmonious terms with someone', 'My dog gets along with everyone as long as they’re not a cat.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (27, 'get around', 'to travel from place to place', 'In this city, it’s impossible to get around without a car.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (28, 'get around to [x]', 'to do something eventually', 'I’ll get around to that project after the playoffs.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (29, 'get at [x]', 'to reach or gain access to something or to indicate or suggest something', 'I can’t quite get at this itch on my back. These graphs are getting at the fact that we’ll be bankrupt by next week.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (30, 'get away', 'to escape or depart', 'Lucio liked to go to the lake every weekend, just to get away.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (31, 'get away with [x]', 'to commit a crime or misdeed without incurring any negative consequences', 'The boss’s nephew gets away with things that none of the other employees would.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (32, 'get [x] back', 'to retrieve something', 'Rodger got his pencil back from Greta. / Rodger got back his pencil from Greta.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (33, 'get back at [x]', 'to take revenge on someone', 'Laila promised herself that she would get back at whoever had started the rumor.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (34, 'get by', 'to survive or manage at a minimum level', 'When Sheila lost her job, the family got by with only their savings.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (35, 'get down', 'to enjoy oneself without inhibitions, especially with music or dancing', 'Vicente may be formal at work, but he sure knows how to get down to hip-hop.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (36, 'get [x] down', 'to depress or discourage someone; to record something by taking notes', 'Lucy always gets everyone down with her stories from the hospital. He spoke quickly, and we were struggling to get all his comments down.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (37, 'get down to something', 'to begin or start something, especially something basic or fundamental', 'Once everyone arrives, we’ll get down to picking teams.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (38, 'get in on [x]', 'to join an activity', 'After the value of Bitcoin started going up, lots of people wanted to get in on cryptocurrency.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (39, 'get into [x]', 'to discuss something thoroughly', 'I don’t want to get into our finances now; we’ll talk after our guests leave.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (40, 'get [x] out of [x]', 'to take some benefit from a situation', 'Babysitting the Cohles was a nightmare, but at least Jabar got some money out of it.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (41, 'get over [x]', 'to recover from or overcome something', 'Drinking a lot of water helps in getting over an illness.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (42, 'get through [x]', 'to complete or endure an unpleasant experience', 'Alessandra can’t get through a morning without coffee.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (43, 'get to [x]', 'to annoy or bother someone', 'People who don’t clean up after their dogs really get to me.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (44, 'get together', 'to gather socially', 'The volleyball team is getting together for dinner after practice.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (45, 'give [x] away', 'to donate something or give something for free', 'Mindy gave her prized doll collection away. / Mindy gave away her prized doll collection.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (46, 'give up', 'to accept defeat, quit, or surrender', 'Carin felt like giving up every time she saw the scoreboard.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (47, 'give [x] up', 'to stop consuming or doing something, often a habit', 'Minh gave chocolate up because of his migraines. / Minh gave up chocolate because of his migraines.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (48, 'go against [x]', 'to disobey, contradict, oppose, or fight something', 'A group of students went against the school dress code yesterday and wore ripped jeans.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (49, 'go ahead', 'to proceed or move forward', 'Because of the snow, we can’t go ahead with the festival.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (50, 'go along with [x]', 'to agree with or pretend to agree with', 'Even though Cedric hated weight lifting, he went along with it because his coach suggested it.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (51, 'go for [x]', 'to try to achieve something', 'Carlos trains so hard because he is going for an Olympic gold medal.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (52, 'go on', 'to continue', 'The workers will go on digging until they hit a water pipe.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (53, 'go over [x]', 'to review or look at something in detail', 'Marie went over the study guide one last time before the test.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (54, 'hand in [x]', 'to submit something, especially an assignment', 'The teacher wants us to hand in our essays by email.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (55, 'hold [x] back', 'to prevent someone from doing something', 'I wanted to become an architect, but my bad grades held me back.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (56, 'keep [x] up', 'to continue doing something', 'Keep this pace up and you’ll set a new record!');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (57, 'leave [x] out', 'to omit something', 'Orna left the graph out of the presentation. / Orna left out the graph from the presentation.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (58, 'let somebody down', 'to disappoint someone', 'I need you to be on time. Don''t let me down this time.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (59, 'let go of [x]', 'to release or free something', 'Don’t let go of the rope until I’m safe.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (60, 'let [x] in', 'to allow something or someone to enter', 'Close the door or you’ll let the flies in! / Close the door or you’ll let in the flies!');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (61, 'let [x] know', 'to tell someone something', 'Let me know as soon as Leslie texts back.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (62, 'look after [x]', 'to take care of someone or something', 'Thank you for looking after me when I was sick.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (63, 'look up to [x]', 'to admire or idolize someone', 'I looked up to this YouTuber until I read about their scandal.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (64, 'mix up [x]', 'to confuse two or more things with one another', 'It’s easy to mix up Chris Pine and Chris Pratt.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (65, 'pull [x] up', 'to retrieve or bring something nearer', 'Eugene pulled the document up on his computer. / Eugene pulled up the document on his computer.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (66, 'put [x] on', 'to dress oneself in', 'I always put my backpack on before leaving the house. / I always put on my backpack before leaving the house.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (67, 'put up with [x]', 'to tolerate or condone something', 'Somehow Paz could put up with Janice’s cynical attitude.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (68, 'run out of something', 'have none left; to use all of or drain the supply of something', 'Isabella ran out of toilet paper at the worst possible time. We ran out of shampoo so I had to wash my hair with soap.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (69, 'see to [x]', 'to make sure something is done', 'I’ll see to watering the plants while you’re gone.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (70, 'set [x] up', 'to arrange or organize something', 'Since no one had invited me to join their study group, I set a group up myself. / Since no one had invited me to join their study group, I set up a group myself.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (71, 'show off', 'to display abilities or accomplishments in order to impress others', 'Panya didn’t need to shoot so many three-pointers; she was just showing off.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (72, 'shut [x] off', 'to turn off, especially a machine', 'Don’t forget to shut the water off after your shower. / Don’t forget to shut off the water after your shower.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (73, 'take after [x]', 'to resemble someone, especially of children about their parents', 'Li takes after his father when it comes to politics.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (74, 'take [x] out', 'to move something outside', 'Please take the garbage out before dinner. / Please take out the garbage before dinner.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (75, 'think [x] over', 'to consider something', 'When his parents suggested selling his Pokémon cards, Yosef thought the idea over. / When his parents suggested selling his Pokémon cards, Yosef thought over the idea.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (76, 'throw [x] away', 'to dispose of something', 'Could you throw that old burrito away? / Could you throw away that old burrito?');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (77, 'top [x] off', 'to refill something to the top; to complete something in a special or spectacular way', 'May I top your beverage off? / May I top off your beverage?');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (78, 'doze off', 'fall asleep slowly, often in the day or when you don’t plan to sleep', 'The office was so hot I nearly dozed off at my desk.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (79, 'wait on [x]', 'to serve someone, especially at a restaurant', 'Billie eagerly waited on the table of new customers, hoping for a big tip.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (80, 'wait out', 'to wait until an even to or period is over', 'They decided to wait out the rain before going on a walk.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (81, 'take [x] over', 'to begin to have control of something. to start doing a job or being responsible for something that another person did or had responsibility for before. to become more successful or powerful than something or someone else that is involved in the same type of activity', 'The firm was badly in need of restructuring when she took over. She took over as manager two weeks ago. It''s only a matter of time before they take over completely.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (82, 'ask somebody out', 'invite on a date', 'Brian asked Judy out to dinner and a movie.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (83, 'ask around', 'ask many people the same question', 'I asked around but nobody has seen my wallet.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (84, 'add up to something', 'equal', 'Your purchases add up to $205.32.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (85, 'back something up', 'reverse', 'You''ll have to back up your car so that I can get out.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (86, 'back somebody up', 'support', 'My wife backed me up over my decision to quit my job.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (87, 'blow up', 'explode', 'The racing car blew up after it crashed into the fence.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (88, 'blow something up', 'add air', 'We have to blow 50 balloons up for the party.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (89, 'break down', 'get upset; stop functioning (vehicle, machine)', 'The woman broke down when her son had died. Our car broke down at the side of the highway.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (90, 'carry away', 'терять контроль над собой', 'I got carried away and spent too much money. he crowd were carried away by his passionate speech. There''s far too much food - I''m afraid I got a bit carried away.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (91, 'break something down', 'divide into smaller parts', 'Our teacher broke the final project down into three separate parts.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (92, 'break in', 'force entry to a building', 'Somebody broke in last night and stole our stereo.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (93, 'break into something', 'enter forcibly', 'The firemen had to break into the room to rescue the children.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (94, 'break something in', 'wear something a few times so that it doesn''t look/feel new', 'I need to break these shoes in before we run next week.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (95, 'break in', 'interrupt', 'The TV station broke in to report the news of the president''s death.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (96, 'break up', 'end a relationship', 'My boyfriend and I broke up before I moved to America.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (97, 'break up', 'start laughing (informal)', 'The kids just broke up as soon as the clown started talking.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (98, 'break out', 'escape', 'The prisoners broke out of jail when the guards weren''t looking.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (99, 'break out in something', 'develop a skin condition', 'I broke out in a rash after our camping trip.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (100, 'bring somebody down', 'make unhappy', 'This sad music is bringing me down.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (101, 'bring somebody up', 'raise a child', 'My grandparents brought me up after my parents died.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (102, 'bring something up', 'start talking about a subject', 'My mother walks out of the room when my father brings up sports.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (103, 'bring something up', 'vomit', 'He drank so much that he brought his dinner up in the toilet.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (104, 'call around', 'phone many different places/people', 'We called around but we weren''t able to find the car part we needed.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (105, 'call somebody back', 'return a phone call', 'I called the company back but the offices were closed for the weekend.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (106, 'call something off', 'cancel', 'Jason called the wedding off because he wasn''t in love with his fiancé.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (107, 'call on somebody', 'ask for an answer or opinion', 'The professor called on me for question 1.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (108, 'call on somebody', 'visit somebody', 'We called on you last night but you weren''t home.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (109, 'call somebody up', 'phone', 'Give me your phone number and I will call you up when we are in town.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (110, 'calm down', 'to relax after being angry or excited', 'You are still mad. You need to calm down before you drive the car.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (111, 'not care for somebody/ something', 'not like (formal)', 'I don''t care for his behaviour.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (112, 'catch up', 'get to the same point as somebody else', 'You''ll have to run faster than that if you want to catch up with Marty.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (113, 'check in', 'arrive and register at a hotel or airport', 'We will get the hotel keys when we check in.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (114, 'check out', 'leave a hotel', 'You have to check out of the hotel before 11:00 AM.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (115, 'check somebody/ something out', 'look at carefully, investigate', 'The company checks out all new employees.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (116, 'check out somebody/ something', 'look at (informal)', 'Check out the crazy hair on that guy!');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (117, 'cheer up', 'become happier', 'She cheered up when she heard the good news.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (118, 'cheer somebody up', 'make happier', 'I brought you some flowers to cheer you up.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (119, 'chip in', 'help', 'If everyone chips in we can get the kitchen painted by noon.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (120, 'clean something up', 'tidy, clean', 'Please clean up your bedroom before you go outside.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (121, 'come across something', 'find unexpectedly', 'I came across these old photos when I was tidying the closet.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (122, 'come apart', 'separate', 'The top and bottom come apart if you pull hard enough.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (123, 'come down with something', 'to catch an illness, to become sick', 'My nephew came down with chicken pox this weekend.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (124, 'come forward', 'volunteer for a task or to give evidence', 'The woman came forward with her husband''s finger prints.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (125, 'come from some place', 'originate in', 'The art of origami comes from Asia.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (126, 'count on somebody/ something', 'rely on', 'I am counting on you to make dinner while I am out.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (127, 'cross something out', 'draw a line through', 'Please cross out your old address and write your new one.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (128, 'cut back on something', 'consume less', 'My doctor wants me to cut back on sweets and fatty foods.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (129, 'cut something down', 'make something fall to the ground', 'We had to cut the old tree in our yard down after the storm.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (130, 'cut in', 'interrupt', 'Your father cut in while I was dancing with your uncle.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (131, 'cut in', 'pull in too closely in front of another vehicle', 'The bus driver got angry when that car cut in.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (132, 'cut in', 'start operating (of an engine or electrical device)', 'The air conditioner cuts in when the temperature gets to 22°C.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (133, 'cut something off', 'remove with something sharp', 'The doctors cut off his leg because it was severely injured.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (134, 'cut something off', 'stop providing', 'The phone company cut off our phone because we didn''t pay the bill.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (135, 'cut somebody off', 'take out of a will', 'My grandparents cut my father off when he remarried.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (136, 'cut something out', 'remove part of something (usually with scissors and paper)', 'I cut this ad out of the newspaper.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (137, 'do somebody/ something over', 'beat up, ransack (BrE, informal)', 'He''s lucky to be alive. His shop was done over by a street gang.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (138, 'do something over', 'do again (AmE)', 'My teacher wants me to do my essay over because she doesn''t like my topic.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (139, 'do away with something', 'discard', 'It''s time to do away with all of these old tax records.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (140, 'do something up', 'fasten, close', 'Do your coat up before you go outside. It''s snowing!');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (141, 'dress up', 'wear nice clothing', 'It''s a fancy restaurant so we have to dress up.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (142, 'drop back', 'move back in a position/group', 'Andrea dropped back to third place when she fell off her bike.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (143, 'drop in/ by/ over', 'come without an appointment', 'I might drop in/by/over for tea sometime this week.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (144, 'drop somebody/ something off', 'take somebody/ something somewhere and leave them/it there', 'I have to drop my sister off at work before I come over.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (145, 'drop out', 'quit a class, school etc', 'I dropped out of Science because it was too difficult.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (146, 'eat out', 'eat at a restaurant', 'I don''t feel like cooking tonight. Let''s eat out.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (147, 'end up', 'eventually reach/do/decide', 'We ended up renting a movie instead of going to the theatre.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (148, 'fall apart', 'break into pieces', 'My new dress fell apart in the washing machine.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (149, 'fall down', 'fall to the ground', 'The picture that you hung up last night fell down this morning.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (150, 'fall out', 'separate from an interior', 'The money must have fallen out of my pocket.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (151, 'fall out', '(of hair, teeth) become loose and unattached', 'His hair started to fall out when he was only 35.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (152, 'figure something out', 'understand, find the answer', 'I need to figure out how to fit the piano and the bookshelf in this room.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (153, 'fill something in', 'to write information in blanks, as on a form (BrE)', 'Please fill in the form with your name, address, and phone number.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (154, 'fill something out', 'to write information in blanks, as on a form (AmE)', 'The form must be filled out in capital letters.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (155, 'fill something up', 'fill to the top', 'I always fill the water jug up when it is empty.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (156, 'find out', 'discover', 'We don''t know where he lives. How can we find out?');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (157, 'find something out', 'discover', 'We tried to keep the time of the party a secret, but Samantha found it out.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (158, 'get something across/ over', 'communicate, make understandable', 'I tried to get my point across/over to the judge but she wouldn''t listen.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (159, 'get along/on', 'like each other', 'I was surprised how well my new girlfriend and my sister got along/on.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (160, 'get around', 'have mobility', 'My grandfather can get around fine in his new wheelchair.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (161, 'get away', 'go on a vacation', 'We worked so hard this year that we had to get away for a week.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (162, 'get away with something', 'do without being noticed or punished', 'Jason always gets away with cheating in his maths tests.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (163, 'get back', 'return', 'We got back from our vacation last week.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (164, 'get something back', 'receive something you had before', 'Liz finally got her Science notes back from my roommate.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (165, 'get back at somebody', 'retaliate, take revenge', 'My sister got back at me for stealing her shoes. She stole my favourite hat.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (166, 'get back into something', 'become interested in something again', 'I finally got back into my novel and finished it.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (167, 'get on something', 'step onto a vehicle', 'We''re going to freeze out here if you don''t let us get on the bus.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (168, 'get over something', 'recover from an illness, loss, difficulty', 'I just got over the flu and now my sister has it.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (169, 'get over something', 'overcome a problem', 'The company will have to close if it can''t get over the new regulations.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (170, 'get round to something', 'finally find time to do (AmE: get around to something)', 'I don''t know when I am going to get round to writing the thank you cards.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (171, 'get together', 'meet (usually for social reasons)', 'Let''s get together for a BBQ this weekend.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (172, 'get up', 'get out of bed', 'I got up early today to study for my exam.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (173, 'get up', 'stand', 'You should get up and give the elderly man your seat.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (174, 'give somebody away', 'reveal hidden information about somebody', 'His wife gave him away to the police.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (175, 'give somebody away', 'take the bride to the altar', 'My father gave me away at my wedding.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (176, 'give something away', 'ruin a secret', 'My little sister gave the surprise party away by accident.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (177, 'give something away', 'give something to somebody for free', 'The library was giving away old books on Friday.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (178, 'give something back', 'return a borrowed item', 'I have to give these skates back to Franz before his hockey game.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (179, 'give in', 'reluctantly stop fighting or arguing', 'My boyfriend didn''t want to go to the ballet, but he finally gave in.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (180, 'give something out', 'give to many people (usually at no cost)', 'They were giving out free perfume samples at the department store.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (181, 'give something up', 'quit a habit', 'I am giving up smoking as of January 1st.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (182, 'give up', 'stop trying', 'My maths homework was too difficult so I gave up.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (183, 'go after somebody', 'follow somebody', 'My brother tried to go after the thief in his car.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (184, 'go after something', 'try to achieve something', 'I went after my dream and now I am a published writer.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (185, 'go against somebody', 'compete, oppose', 'We are going against the best soccer team in the city tonight.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (186, 'go ahead', 'start, proceed', 'Please go ahead and eat before the food gets cold.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (187, 'go back', 'return to a place', 'I have to go back home and get my lunch.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (188, 'go out', 'leave home to go on a social event', 'We''re going out for dinner tonight.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (189, 'go out with somebody', 'date', 'Jesse has been going out with Luke since they met last winter.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (190, 'go over something', 'review', 'Please go over your answers before you submit your test.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (191, 'go over', 'visit somebody nearby', 'I haven''t seen Tina for a long time. I think I''ll go over for an hour or two.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (192, 'go without something', 'suffer lack or deprivation', 'When I was young, we went without winter boots.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (193, 'grow apart', 'stop being friends over time', 'My best friend and I grew apart after she changed schools.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (194, 'grow back', 'regrow', 'My roses grew back this summer.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (195, 'grow into something', 'grow big enough to fit', 'This bike is too big for him now, but he should grow into it by next year.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (196, 'grow out of something', 'get too big for', 'Elizabeth needs a new pair of shoes because she has grown out of her old ones.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (197, 'grow up', 'become an adult', 'When Jack grows up he wants to be a fireman.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (198, 'hand something down', 'give something used to somebody else', 'I handed my old comic books down to my little cousin.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (199, 'hand something in', 'submit', 'I have to hand in my essay by Friday.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (200, 'hand something out', 'to distribute to a group of people', 'We will hand out the invitations at the door.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (201, 'hand something over', 'give (usually unwillingly)', 'The police asked the man to hand over his wallet and his weapons.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (202, 'hang in', 'stay positive (informal)', 'Hang in there. I''m sure you''ll find a job very soon.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (203, 'hang on', 'wait a short time (informal)', 'Hang on while I grab my coat and shoes!');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (204, 'hang out', 'spend time relaxing (informal)', 'Instead of going to the party we are just going to hang out at my place.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (205, 'hang up', 'end a phone call', 'He didn''t say goodbye before he hung up.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (206, 'hold somebody/ something back', 'prevent from doing/going', 'I had to hold my dog back because there was a cat in the park.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (207, 'hold something back', 'hide an emotion', 'Jamie held back his tears at his grandfather''s funeral.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (208, 'hold on', 'wait a short time', 'Please hold on while I transfer you to the Sales Department.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (209, 'hold onto somebody/ something', 'hold firmly using your hands or arms', 'Hold onto your hat because it''s very windy outside.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (210, 'hold somebody/ something up', 'rob', 'A man in a black mask held the bank up this morning.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (211, 'keep on doing something', 'continue doing', 'Keep on stirring until the liquid comes to a boil.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (212, 'keep something from somebody', 'not tell', 'We kept our relationship from our parents for two years.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (213, 'keep somebody/ something out', 'stop from entering', 'Try to keep the wet dog out of the living room.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (214, 'keep something up', 'continue at the same rate', 'If you keep those results up you will get into a great college.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (215, 'put somebody out', 'выводить из себя / обременять / делать что-то для кого-то, когда тебе это неудобно', 'She was very put out when they turned up two hours late for dinner. / Would it put you out if we came tomorrow instead of today? / Ethan is always willing to put himself out for other people.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (216, 'let somebody in', 'allow to enter', 'Can you let the cat in before you go to school?');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (217, 'log in (or on)', 'sign in (to a website, database etc)', 'I can''t log in to Facebook because I''ve forgotten my password.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (218, 'log out (or off)', 'sign out (of a website, database etc)', 'If you don''t log off somebody could get into your account.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (219, 'look after somebody/ something', 'take care of', 'I have to look after my sick grandmother.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (220, 'look down on somebody', 'think less of, consider inferior', 'Ever since we stole that chocolate bar your dad has looked down on me.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (221, 'look for somebody/ something', 'try to find', 'I''m looking for a red dress for the wedding.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (222, 'look forward to something', 'be excited about the future', 'I''m looking forward to the Christmas break.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (223, 'look into something', 'investigate', 'We are going to look into the price of snowboards today.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (224, 'look out', 'be careful, vigilant, and take notice', 'Look out! That car''s going to hit you!');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (225, 'look out for somebody/ something', 'be especially vigilant for', 'Don''t forget to look out for snakes on the hiking trail.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (226, 'look something over', 'check, examine', 'Can you look over my essay for spelling mistakes?');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (227, 'look something up', 'search and find information in a reference book or database', 'We can look her phone number up on the Internet.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (228, 'look up to somebody', 'have a lot of respect for', 'My little sister has always looked up to me.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (229, 'make something up', 'invent, lie about something', 'Josie made up a story about why we were late.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (230, 'make up', 'forgive each other', 'We were angry last night, but we made up at breakfast.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (231, 'make somebody up', 'apply cosmetics to', 'My sisters made me up for my graduation party.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (232, 'mix something up', 'confuse two or more things', 'I mixed up the twins'' names again!');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (233, 'pass away', 'die', 'His uncle passed away last night after a long illness.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (234, 'pass out', 'faint', 'It was so hot in the church that an elderly lady passed out.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (235, 'pass something out', 'give the same thing to many people', 'The professor passed the textbooks out before class.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (236, 'pass something up', 'decline (usually something good)', 'I passed up the job because I am afraid of change.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (237, 'pay somebody back', 'return owed money', 'Thanks for buying my ticket. I''ll pay you back on Friday.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (238, 'pay for something', 'be punished for doing something bad', 'That bully will pay for being mean to my little brother.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (239, 'pick something out', 'choose', 'I picked out three sweaters for you to try on.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (240, 'point somebody/ something out', 'indicate with your finger', 'I''ll point my boyfriend out when he runs by.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (241, 'put something down', 'put what you are holding on a surface or floor', 'You can put the groceries down on the kitchen counter.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (242, 'put somebody down', 'insult, make somebody feel stupid', 'The students put the substitute teacher down because his pants were too short.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (243, 'put something off', 'postpone', 'We are putting off our trip until January because of the hurricane.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (244, 'put something out', 'extinguish', 'The neighbours put the fire out before the firemen arrived.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (245, 'put something together', 'assemble', 'I have to put the crib together before the baby arrives.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (246, 'put up with somebody/ something', 'tolerate', 'I don''t think I can put up with three small children in the car.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (247, 'put something on', 'put clothing/ accessories on your body', 'Don''t forget to put on your new earrings for the party.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (248, 'run into somebody/ something', 'meet unexpectedly', 'I ran into an old school-friend at the mall.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (249, 'run over somebody/ something', 'drive a vehicle over a person or thing', 'I accidentally ran over your bicycle in the driveway.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (250, 'run over/ through something', 'rehearse, review', 'Let''s run over/through these lines one more time before the show.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (251, 'run away', 'leave unexpectedly, escape', 'The child ran away from home and has been missing for three days.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (252, 'look at something', 'to think about something carefully so that you can make a decision about it', 'Management is looking at ways of cutting costs.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (253, 'send something back', 'return (usually by mail)', 'My letter got sent back to me because I used the wrong stamp.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (254, 'set something up', 'arrange, organize', 'Our boss set a meeting up with the president of the company.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (255, 'set somebody up', 'trick, trap', 'The police set up the car thief by using a hidden camera.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (256, 'shop around', 'compare prices', 'I want to shop around a little before I decide on these boots.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (257, 'show off', 'act extra special for people watching (usually boastfully)', 'He always shows off on his skateboard');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (258, 'sleep over', 'stay somewhere for the night (informal)', 'You should sleep over tonight if the weather is too bad to drive home.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (259, 'sort something out', 'organize, resolve a problem', 'We need to sort the bills out before the first of the month.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (260, 'stick to something', 'continue doing something, limit yourself to one particular thing', 'You will lose weight if you stick to the diet.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (261, 'switch something off', 'stop the energy flow, turn off', 'The light''s too bright. Could you switch it off.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (262, 'switch something on', 'start the energy flow, turn on', 'We heard the news as soon as we switched on the car radio.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (263, 'take after somebody', 'resemble a family member', 'I take after my mother. We are both impatient.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (264, 'take something apart', 'purposely break into pieces', 'He took the car brakes apart and found the problem.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (265, 'take something back', 'return an item', 'I have to take our new TV back because it doesn''t work.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (266, 'take off', 'start to fly', 'My plane takes off in five minutes.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (267, 'take something off', 'remove something (usually clothing)', 'Take off your socks and shoes and come in the lake!');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (268, 'take something out', 'remove from a place or thing', 'Can you take the garbage out to the street for me?');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (269, 'take somebody out', 'pay for somebody to go somewhere with you', 'My grandparents took us out for dinner and a movie.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (270, 'tear something up', 'rip into pieces', 'I tore up my ex-boyfriend''s letters and gave them back to him.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (271, 'think back', 'remember (often + to, sometimes + on)', 'When I think back on my youth, I wish I had studied harder.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (272, 'think something over', 'consider', 'I''ll have to think this job offer over before I make my final decision.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (273, 'throw something away', 'dispose of', 'We threw our old furniture away when we won the lottery.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (274, 'turn something down', 'refuse or reject; decrease the volume or strength (heat, light, etc)', 'I turned the job down because I don''t want to move. My crush turned me down after I asked them out. Please turn the TV down while the guests are here.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (275, 'trip over ', 'споткнуться', 'I''ve just tripped over a dog ');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (276, 'turn something off', 'stop the energy flow, switch off', 'Your mother wants you to turn the TV off and come for dinner.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (277, 'turn something on', 'start the energy, switch on', 'It''s too dark in here. Let''s turn some lights on.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (278, 'turn something up', 'increase the volume or strength (heat, light, etc.)', 'Can you turn the music up? This is my favourite song.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (279, 'turn up', 'appear suddenly', 'Our cat turned up after we put posters up all over the neighbourhood.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (280, 'try something on', 'sample clothing', 'I''m going to try these jeans on, but I don''t think they will fit.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (281, 'try something out', 'test', 'I am going to try this new brand of detergent out.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (282, 'use something up', 'finish the supply', 'The kids used all the toothpaste up, so we need to buy some more.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (283, 'wake up', 'stop sleeping', 'We have to wake up early for work on Monday.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (284, 'warm somebody/ something up', 'increase the temperature', 'You can warm your feet up in front of the fireplace.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (285, 'warm up', 'prepare body for exercise', 'I always warm up by doing sit-ups before I go for a run.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (286, 'wear off', 'fade away', 'Most of my make-up wore off before I got to the party.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (287, 'work out', 'exercise', 'I work out at the gym three times a week.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (288, 'work out', 'be successful', 'Our plan worked out fine.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (289, 'work something out', 'make a calculation', 'We have to work out the total cost before we buy the house.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (290, 'ask for', 'to request for something or a favor', 'She asked me for help');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (291, 'talk someone into something', 'persuade', 'He''s against this idea, but I think I can talk him into it.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (292, 'talk something over', 'discuss', 'I''d like to talk your offer over with my wife.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (293, 'cook something up', 'to invent a story, plan, etc., usually dishonestly', 'She cooked up some weird scheme that was going to earn her a fortune. I had to cook up an excuse about my car breaking down.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (294, 'hook up', 'to meet, to begin to work with someone, to begin a romantic or sexual relationship with someone', 'He hooked up with the other members of the band in Amsterdam.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (295, 'fresh out of something', 'having just finished or sold all of something', 'We’re fresh out of oranges, would you like an apple?');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (296, 'fresh out of somewhere', 'having just arrived from somewhere', 'We hired her fresh out of college.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (297, 'live up to something', 'justify expectations', 'The concert was brilliant - it lived up to all our expectations.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (298, 'gettING on', 'become older', 'I can''t remember your name. I''m getting on.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (299, 'carry out', 'struggle with something, not give up and complete successfully', 'The task was difficult, but I carried it out. ');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (300, 'speak up', 'talk about something open, sharing your feelings', 'He annoyed me, and I spoke up to him everything.');
INSERT INTO public.phrasal (id, verb, meaning, examples) VALUES (301, 'depend on', 'rely on somebody, trust him or her', 'You can depend on me with this task.');
